import React from 'react';


class SignIn extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            username: '',
            password: ''
        };
    }

    handleSubmit = (event) => {
        event.preventDefault();
        this.state.username = '';
        this.state.password = '';
    }

    handleChange = (ev) => {
        const { name, value } = ev.target;
        this.setState({ [name]: value });
    }

    render() {
        return (
            <div className="sign-in">
                <h2>I already have an account</h2>
                <span>Sign in with your email and password</span>
                <form onSubmit={this.handleSubmit}>
                    <input name="email" type="email" value={this.state.email} required onChange={ (ev) => this.handleChange(ev) }/>
                    <label>Email</label>
                    <input name="password" type="password" value={this.state.password} required onChange={(ev) => this.handleChange(ev)}/>
                    <label>Password</label>
                    <input type="submit" value="Submit Form"></input>
                </form>
            </div>
        );
    }
}

export default SignIn;
